import pandas as pd # pandas 패키지를 사용
import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense, Dropout

"""Pandas는 데이터 처리와 정돈, 탐색, 시각화를 위한 기능들을 제공합니다. 여기에는 데이터 불러오기, 결측치 처리, 데이터 필터링, 그룹화, 변형, 병합, 피벗 테이블 등 다양한 기능이 포함되어 있습니다."""

column_name = ['age', 'sex', 'cp', 'treshbps', 'chol', 'fbs', 'restecg','thalach', 'exang', 'oldpeak', 'slop', 'ca', 'thal', 'HeartDisease']
raw_data = pd.read_excel('./datasets/heart-disease.xlsx', header=None, names=column_name)
print(raw_data.head()) # ? 인 문자를 해결하기 위해서

raw_data.info() # datatype에 대한 안내를 해줌.

raw_data.describe()

clean_data=raw_data.replace('?',np.nan) # ?가 있다면 none 값으로 바꾸겠다는 의미 -> 데이터 타입은 float
clean_data = clean_data.dropna()
# clean_data: 누락된 데이터가 있는 데이터프레임
# dropna(): 누락된 데이터가 있는 행을 삭제하는 메서드
clean_data.info()

keep = column_name.pop() #pop 메서드를 사용하여 리스트에서 마지막 요소를 추출하고, 추출된 값을 반환합니다. 동시에 리스트에서는 해당 요소가 삭제
print(keep)
print(column_name)

training_data = clean_data[column_name] #  이 부분은 데이터프레임 clean_data에서 column_name에 해당하는 열(column)을 선택합니다.
target=clean_data[[keep]] #이 부분은 데이터프레임(=표 형태) clean_data에서 keep에 해당하는 열들을 선택합니다. [[...]]를 사용하여 선택한 열들을 포함하는 새로운 데이터프레임을 생성합니다.
# 시리즈는 무조건 column이 하나야. 이럴 경우 대괄호를 하나만 정해주면 됨.
# [[keep]] 이런식으로 이중 대괄호를 통해서 시리즈가 아닌 데이터프레임 형태로 바꿔 준것이다.
print(training_data)
print(target)

print(target['HeartDisease'].sum()) # 데이터가 불균형 할경우 잘못된 데이터라도 복붙을 해서 데이터 수를 맞춰야해

print(target['HeartDisease'].mean()) # target 데이터프레임에서 'HeartDisease' 열을 선택한 뒤, 해당 열의 평균값을 계산

# 스케일링을 한 후에 모델을 만들것임.
# 표준정규화: 평균은 0이 되게 만들어, 표준편차가 1
from sklearn.preprocessing import StandardScaler
scaler = StandardScaler() # 스탠다드 스케일러를 하고
scaled_data= scaler.fit_transform(training_data) # 데이터를 넘겨줌
scaled_data = pd.DataFrame(scaled_data, columns=column_name)
print(scaled_data)

scaled_data.describe()

scaled_data.describe().T # 이렇게 하면 행열이 바꿔서 나옴.

boxplot = scaled_data.boxplot(column=column_name, showmeans=True) # boxplot 그리기-> True로 주면 평균을 출력함.
plt.show()

"""중위값 밑이 1,2 분위가 됨. 가운데가 선이 중위값. 가운데에서 위에가 3,4 분위 값, 동그라미: 특이값( 중간 범위에서 1.5배를 한 값에서 넘어가면 특이값이 됨. 1.5배를 한 값 안에서 큰값이 최대값이 됨. )"""

boxplot = scaled_data.boxplot(column=column_name, showmeans=False) # boxplot 은 정확한 표준편차 값, 평균을 출력하지 않음.
plt.show()

from sklearn.model_selection import train_test_split
x_train, x_test, y_train , y_test = train_test_split(
scaled_data,target,test_size=0.03) # 296개 데이터 중에서 30프로를 때어놓고 70프로만을 가지고 테스트를 하는 거야. 그 후에 30개의 데이터를 가지고 검증을 해보는 거야
# 심장병 유무에 따라 나눠 놓고 거기서 70프로씩 뽑아서 비교를 해보는 것이 더 정확함.
print('x_train shape',x_train.shape)
print('y_train shape',y_train.shape)
print('x_test shape',x_test.shape)
print('y_test shape',y_test.shape)

model = Sequential()
model.add(Dense(512, input_dim=13, activation= 'relu'))
model.add(Dropout(0.25))
model.add(Dense(256,  activation= 'relu')) # relu를 쓰는 이유:
model.add(Dropout(0.2))
model.add(Dense(128,  activation= 'relu'))
model.add(Dropout(0.1)) #dropout을 쓰는 이유: 과적합을 막기 위함.
model.add(Dense(1,  activation= 'sigmoid')) # 여기서 1은 출력 갯수를 의미. 이진분류기에서는 1개만 출력돼
model.summary()

"""14*512=7168 , 513*256=131328, 257*128 = 32896
 이로써 파라미터값이 올바르게 나온것을 알 수 있습니다.

![52.jpg](data:image/jpeg;base64,)

dropout은 그릴 수가 없어.

Dropout은 신경망의 과적합(overfitting)을 줄이기 위한 정규화(regularization) 기법 중 하나입니다. 과적합은 모델이 훈련 데이터에 지나치게 적응되어 새로운 데이터에 대한 일반화 성능이 떨어지는 현상을 의미합니다.

ex) 얼굴 인식 도어락인데, 등록해놨던 얼굴에 수박씨를 묻혀서 얼굴인식이 안되는 경우. 이런경우를 과적합이라고 함.

batch_size= 50
: 전체 데이터를 한꺼번에 하는 게 아니라 잘라서 돌린다는 거야.

 ex) 문제집을 사서 앞에 50문제만을 풀어보고 답을 맞춰봄, 그러고 나서 새로운 문제를 풀어봐 이렇게 하면 효율이 좋음.  
 ex) 메모리 용량 부족해서 안되는 것도 잘라서 수행하면 돌릴 수 있습니다.

![image.png](data:image/png;base64,)

metrics : 혼돈 행렬
Ex) 0.4이면 positive으로 넘어가, 0.6이면 negative로 넘어가. 0.5를 기준으로 0 과 1로 넘어감.  
ex) 스팸(negative: 안좋은것)과 스팸이 아닌것(positive: 좋은것) 일때 type 2 error는 중요한 메일이 스팸 메일함에 들어가 있을 수도 있어.  
 여기서 type 1 error , type 2 error를 조절해야해.
 ex) positive : 코로나에 안걸린것 , negative: 코로나에 걸린것
 걸렸는 데 안 걸린다고 예측하는 게 문제가 되는 거야. 그래서 Precision이 중요해.
"""

model.compile(loss='mse', optimizer='adam', metrics= ['binary_accuracy'])
fit_hist=model.fit(x_train,y_train,batch_size= 50,epochs=20,validation_split=0.2,verbose=1)

# verbose 출력되는 형태를 말해. (0,1,2.. 이런 숫자에 따라 형태가 달라져 ) ex) verbose = 1 이면 val_loss: 0.1582 이런식으로 나오고 , verbose = 0이면 아예 안나온다던지~
# 아까 떼어놨던 20프로 -> 1/5 (복원 추출 해)
# 1/5 확률, 1/25 , 1/125 ... 이런식으로 복원 추출을 해서 점점 값이 작아지는 것을 알 수 있어.
# 20프로의 weight와 dropout
# binary_accuracy는 맞춘갯수를 의미하는 거야.

plt.plot(fit_hist.history['binary_accuracy'])
plt.plot(fit_hist.history['val_binary_accuracy'])
plt.show()
# 파란색 그래프와 주황색 그래프가 맞물렸을 때까지가 가장 좋아. 그것을 넘으면 이미 학습 되어서 문제를 다 기억하고 있어 그래서 정확도가 더 떨어지게 됨.

score =model.evaluate(x_test, y_test,verbose=0)
print('Keras DNN model loss:',score[0])
print('Keras DNN model accuracy:',score[1])
# score가 두개가 있구나를 알 수 있음. 여기서 loss와 accuracy가 있어.
#evaluate는 검증만 하고 학습은 못해. 답이 틀리면 다시 실행을 해야해. 답을 알려주면 안되니까.

